    <style data-theme="v8" data-color-scheme="light">
      :root {
        color-scheme: light;
      }

      *, *:before, *:after {
        box-sizing: border-box;
      }

      html, body, div, span, svg {
        margin: 0;
        padding: 0;
        border: none;
        vertical-align: baseline;
      }

      body, html {
        width: 100%;
        height: 100%;
        margin: 0;
        display: block;
      }

      {/* used on loading page */}
      .osdWelcomeView {
        line-height: 1.5;
        background-color: #F0F2F4;
        height: 100%;
        display: -webkit-box;
        display: -webkit-flex;
        display: -ms-flexbox;
        display: flex;
        -webkit-box-flex: 1;
        -webkit-flex: 1 0 auto;
            -ms-flex: 1 0 auto;
                flex: 1 0 auto;
        -webkit-box-orient: vertical;
        -webkit-box-direction: normal;
        -webkit-flex-direction: column;
            -ms-flex-direction: column;
                flex-direction: column;
        -webkit-box-align: center;
        -webkit-align-items: center;
            -ms-flex-align: center;
                align-items: center;
        -webkit-box-pack: center;
        -webkit-justify-content: center;
            -ms-flex-pack: center;
                justify-content: center;
      }

      .legacyBrowserErrorLogo {
        height: 64px;
      }

      .osdWelcomeTitle {
        color: #0A1219;
        font-size: 20px;
        margin: 16px 0;
        animation: fadeIn 1s ease-in-out;
        animation-fill-mode: forwards;
        opacity: 0;
        animation-delay: 1.0s;
      }

      .osdWelcomeText {
        display: inline-block;
        font-size: 14px;
        line-height: 40px !important;
        height: 40px !important;
        color: #5A6875;
      }

      .osdLoaderWrap {
        text-align: center;
        line-height: 1;
        text-align: center;
        letter-spacing: -.005em;
        -webkit-text-size-adjust: 100%;
        -ms-text-size-adjust: 100%;
        font-kerning: normal;
        font-weight: 400;
      }

      .osdLoaderWrap svg {
        width: 64px;
        height: 64px;
        margin: auto;
        line-height: 1;
      }

      .osdLoader path {
        stroke: white;
      }

      .osdProgress {
        display: inline-block;
        position: relative;
        width: 32px;
        height: 4px;
        overflow: hidden;
        background-color: #E3E5E8;
        line-height: 1;
      }

      .osdProgress:before {
        position: absolute;
        content: '';
        height: 4px;
        width: 100%;
        top: 0;
        bottom: 0;
        left: 0;
        transform: scaleX(0) translateX(0%);
        animation: osdProgress 1s cubic-bezier(.694, .0482, .335, 1) infinite;
        background-color: #006DE4;
      }

      .loadingLogoContainer {
        height: 80px;
        padding: 8px;
      }

      .loadingLogo {
        height: 100%;
        max-width: 100%;
      }

      @keyframes osdProgress {
        0% {
          transform: scaleX(1) translateX(-100%);
        }

        100% {
          transform: scaleX(1) translateX(100%);
        }
      }
    </style>

      .vis-configuration-popup {
        background: rgba(57, 76, 89, 0.85);
        border: 2px solid #f2faff;
        border-radius: 4px;
        color: #fff;
        font-size: 14px;
        height: 30px;
        line-height: 30px;
        position: absolute;
        text-align: center;
        -webkit-transition: opacity 0.3s ease-in-out;
        -moz-transition: opacity 0.3s ease-in-out;
        transition: opacity 0.3s ease-in-out;
        width: 150px;
      }
      .vis-configuration-popup:after,
      .vis-configuration-popup:before {
        border: solid transparent;
        content: " ";
        height: 0;
        left: 100%;
        pointer-events: none;
        position: absolute;
        top: 50%;
        width: 0;
      }
      .vis-configuration-popup:after {
        border-color: rgba(136, 183, 213, 0) rgba(136, 183, 213, 0)
          rgba(136, 183, 213, 0) rgba(57, 76, 89, 0.85);
        border-width: 8px;
        margin-top: -8px;
      }
      .vis-configuration-popup:before {
        border-color: rgba(194, 225, 245, 0) rgba(194, 225, 245, 0)
          rgba(194, 225, 245, 0) #f2faff;
        border-width: 12px;
        margin-top: -12px;
      }
      div.vis-tooltip {
        background-color: #f5f4ed;
        border: 1px solid #808074;
        -moz-border-radius: 3px;
        -webkit-border-radius: 3px;
        border-radius: 3px;
        box-shadow: 3px 3px 10px rgba(0, 0, 0, 0.2);
        color: #000;
        font-family: verdana;
        font-size: 14px;
        padding: 5px;
        pointer-events: none;
        position: absolute;
        visibility: hidden;
        white-space: nowrap;
        z-index: 5;
      }
      div.vis-network div.vis-navigation div.vis-button {
        -webkit-touch-callout: none;
        background-position: 2px 2px;
        background-repeat: no-repeat;
        -moz-border-radius: 17px;
        border-radius: 17px;
        cursor: pointer;
        display: inline-block;
        height: 34px;
        position: absolute;

        -khtml-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        width: 34px;
      }
